import React from "react";
import {NavLink} from "react-router-dom";
import s from "./Headerlogin.module.css";

const Header = () => {
    return (
        <div className={s.wrapper}>
            <div className={s.itemtitle}>  администратора </div>
            <div className={s.navi}>
            <NavLink to="/" activeClassName={s.active}>Перейти на сайт</NavLink>
            <NavLink to="/centre" activeClassName={s.active}> Выйти </NavLink>
            </div>
        </div>)
}

export default Header;
